var MediaMatrix = {
    core: {},
    space:{},

    innerproduct: function (v1, v2){
        var sum = 0;
        for (var i = 0; i < v1.length && i < v2.length; i += 1) {
            var value1 = isNaN(v1[i]) ? 0 : v1[i];
            var value2 = isNaN(v2[i]) ? 0 : v2[i];
            sum += (value1 * value2);
        }
        return sum;
    },

    histogram: function (bitmap, colorImpression){
        var colors = colorImpression.colors();
        var pixels = bitmap.length / 3;
        var result = new Array(colors.length);

        for (var j = 0; j < pixels; j += 1) {
            var r = bitmap[j * 3];
            var g = bitmap[j * 3 + 1];
            var b = bitmap[j * 3 + 2];
            var color = Object.create(MediaMatrix.core.HSVColor);
            color.initWithRGB(r, g, b);
            var near = colorImpression.nearestColor(color);
            if(near != null){
                result[colorImpression.indexOf(near.toString())] += 1;
            }
        }
        return result;
    },
};

MediaMatrix.core.HSVColor = function(){
    var re = /^(\w+\/[\w\.]+)\((\d{1,3}),\s*(\d{1,3}),\s*(\d{1,3})\)$/;
    return {
        _init: function() {
            this.name = null;
            this.r = 0;
            this.g = 0;
            this.b = 0;
            this.h = 0;
            this.s = 0;
            this.v = 0;
            this.hsx = 0;
            this.hsy = 0;
        },

        init: function(colorString) {
            var bits = re.exec(colorString);
            if (bits) {
                this.name = bits[1];
                this.r = parseInt(bits[2]);
                this.g = parseInt(bits[3]);
                this.b = parseInt(bits[4]);
            }
            this.convertRGBtoHSV();
            return this;
        },

        initWithRGB: function(r, g, b){
            this._init();
            this.r = r;
            this.g = g;
            this.b = b;
            this.convertRGBtoHSV();
            return this;
        },

        convertRGBtoHSV: function(){
            var cmax = (this.r > this.g) ? this.r : this.g;
            if (this.b > cmax) {
                cmax = this.b;
            }
            var cmin = (this.r < this.g) ? this.r : this.g;
            if (this.b < cmin){
                cmin = this.b;
            }
            this.v = cmax / 255.0;
            if (cmax != 0) {
                this.s = (cmax - cmin) / cmax;
            } else {
                this.s = 0;
            }
            if (this.s == 0) {
                this.hue = 0;
            } else {
                var redc = (cmax - this.r) /  (cmax - cmin);
                var greenc = (cmax - this.g) / (cmax - cmin);
                var bluec = (cmax - this.b) /  (cmax - cmin);
                if (this.r == cmax) {
                    this.h = bluec - greenc;
                } else if (this.g == cmax) {
                    this.h = 2.0 + redc - bluec;
                } else {
                    this.h = 4.0 + greenc - redc;
                }
                this.h = this.h / 6.0;
                if (this.h < 0) {
                    this.h = this.h + 1.0;
                }
            }
            this.hsx = this.s * Math.cos(2 * Math.PI * this.h);
            this.hsy = this.s * Math.sin(2 * Math.PI * this.h);
        },

        distance: function(color) {
            var xDiff = this.v  - color.v ;
            var yDiff = this.v  - color.v ;
            var xDiff = this.v * this.hsx - color.v * color.hsx;
            var yDiff = this.v * this.hsy - color.v * color.hsy;
            var valueDiff = this.v - color.v;
            return (xDiff * xDiff) + (yDiff * yDiff) + (valueDiff * valueDiff);
        },

        toHex: function () {
            var r = this.r.toString(16);
            var g = this.g.toString(16);
            var b = this.b.toString(16);
            if (r.length == 1) r = '0' + r;
            if (g.length == 1) g = '0' + g;
            if (b.length == 1) b = '0' + b;
            return '#' + r + g + b;
        },

        toString: function () {
            return this.name + "("+ this.r + ","+ this.g + "," + this.b + ")";
        }
    };
}();

MediaMatrix.core.ColorImpression = function (){
    return {
        _init: function() {
            this.colorString = [];
            this.colorObjects = [];
            this.impressions =[];
        },

        predefined: function(name) {
            this._init();
            this.colorString = MediaMatrix.space[name].colorString;
            this.impressions = MediaMatrix.space[name].impressions;
            for (var i = 0; i < this.colorString.length; i += 1) {
                this.colorObjects.push(Object.create(MediaMatrix.core.HSVColor).init(this.colorString[i]));
            }
        },

        colors: function() {
            return this.colorObjects;
        },

        indexOf: function(colorName) {
            for (var i = 0; i < this.colorString.length; i += 1) {
                if (colorName === this.colorString[i]) {
                    return i;
                }
            }
            throw new Error("Color_Not_Found: " + colorName);
        },

        histogram: function (bitmap){
            var colors = this.colors(), pixels = bitmap.length / 3,
                result = new Array(colors.length), i, color, near;

            for (i = 0; i < result.length; i += 1) {
                result[i] = 0;
            }

            for (i = 0; i < pixels; i += 1) {
                color = Object.create(MediaMatrix.core.HSVColor);
                color.initWithRGB(bitmap[i * 3], bitmap[i * 3 + 1], bitmap[i * 3 + 2]);
                near = this.nearestColor(color);
                if(near != null){
                    result[this.indexOf(near.toString())] += 1;
                }
            }

            for (i = 0; i < result.length; i += 1) {
                result[i] = result[i] / pixels;
            }

            return result;
        },

        //大きい順にソート
        impressionObject: function(vector) {
            var result = new Array(this.impressions.length);
            for (var i = 0; i < this.impressions.length; i = i+1) {
                var name = this.impressions[i][0];
                var cicVector = this.impressions[i].slice(1);
                var score = MediaMatrix.innerproduct(vector, cicVector);
                result[i] = {
                    "name": name,
                    "score": score
                };
            }
            result.sort ( function (b1, b2) {
                var diff = b1.score - b2.score;
                if (diff === 0) {
                    diff = (b1.name < b2.name) ? 1 : -1;
                }
                return diff;
            });
            return result.reverse();
        },

        nearestColor: function(color) {
            var min = Number.MAX_VALUE;
            var result = null;
            for (var i = 0; i < this.colorObjects.length; i = i+1) {
                var distance = this.colorObjects[i].distance(color);
                if (distance < min) {
                    min = distance;
                    result = this.colorObjects[i];
                }
            }
            return result;
        }
    };
}();

