var http = require('http');
var qs = require('querystring');
var server = http.createServer();
server.on('request', function(req, res){
    if(req.method=='POST') {
        var body='';
        req.setEncoding('utf8');
        req.on('data', function (data) {
            body += data;
        });
        req.on('end',function(){
            var POST =  qs.parse(body);
            var csv = require('ya-csv');
            var reader = csv.createCsvFileReader('rgbdata.csv');
            var data = [];

            reader.on('data', function(record) {
                data.push(record);
            }).on('end', function() {
                //console.log(data);
                var arry = data[0];
                var len = arry.length;
                var bitmap = [];
                for(var i = 0; i < len; i++ ) {
                    bitmap.push(arry[i]);
                }
                console.log(bitmap.length);

                var colorImpression = Object.create(MediaMatrix.core.ColorImpression);
                colorImpression.predefined("CIC");
                var histogram = colorImpression.histogram(bitmap);

                var result_array = {};
                var result_name = [];
                var result_score = [];

                for(var i=0; i<colorImpression.impressionObject(histogram).length; i++){
                    result_name.push(colorImpression.impressionObject(histogram)[i].name);
                    result_score.push(colorImpression.impressionObject(histogram)[i].score);
                }

                result_array["name"]=(result_name);
                result_array["score"]=(result_score);

                res.writeHead(200, {'Content-Type' : 'application/json'});
                console.log(result_array);
                res.end(JSON.stringify(result_array));
            });

        });
    } else {
        res.writeHead(200, {'Content-Type': 'text/plain'});
        res.end('Hello Apache!\n');
    }
});
server.listen('49999','160.16.201.12');
console.log("server listening...");
